import React, { useState } from 'react'

const ClickyButton = (props) => {
    const { setButtonClicks, buttonClicks } = props
    const { buttonClicksState, setButtonClicksState } = useState(buttonClicks)

    return (
        <button onClick={setButtonClicksState(buttonClicksState+1)}>
        click me
        </button>
    )
}

export default ClickyButton
